import React, { useState } from 'react';
import HeroSection from './HeroSection';
import TeamSection from './TeamSection';
import ConuAISection from './ConuAISection';
import QuantFundSection from './QuantFundSection';
import AboutSection from './AboutSection';
import EventCards from './EventCards';

function MyMain() {
    const [currentSection, setCurrentSection] = useState('home');

    const renderSection = () => {
        switch(currentSection) {
            case 'team':
                return <TeamSection />;
            case 'conuai':
                return <ConuAISection />;
            case 'quantfund':
                return <QuantFundSection />;
            case 'about':
                return <AboutSection />;
            case 'events':
                return <EventCards />;
            default:
                return <HeroSection />;
        }
    };

    return (
        <main className="flex-auto">
            <nav className="flex justify-center space-x-4 p-4">
                <button 
                    onClick={() => setCurrentSection('home')}
                    className={`px-4 py-2 rounded ${currentSection === 'home' ? 'bg-blue-500 text-white' : 'bg-gray-200'}`}
                >
                    Home
                </button>
                <button 
                    onClick={() => setCurrentSection('about')}
                    className={`px-4 py-2 rounded ${currentSection === 'about' ? 'bg-blue-500 text-white' : 'bg-gray-200'}`}
                >
                    About
                </button>
                <button 
                    onClick={() => setCurrentSection('team')}
                    className={`px-4 py-2 rounded ${currentSection === 'team' ? 'bg-blue-500 text-white' : 'bg-gray-200'}`}
                >
                    Team
                </button>
                <button 
                    onClick={() => setCurrentSection('events')}
                    className={`px-4 py-2 rounded ${currentSection === 'events' ? 'bg-blue-500 text-white' : 'bg-gray-200'}`}
                >
                    Activities
                </button>
                <button 
                    onClick={() => setCurrentSection('conuai')}
                    className={`px-4 py-2 rounded ${currentSection === 'conuai' ? 'bg-blue-500 text-white' : 'bg-gray-200'}`}
                >
                    ConuAI
                </button>
                <button 
                    onClick={() => setCurrentSection('quantfund')}
                    className={`px-4 py-2 rounded ${currentSection === 'quantfund' ? 'bg-blue-500 text-white' : 'bg-gray-200'}`}
                >
                    Quant Fund
                </button>
            </nav>
            {renderSection()}
        </main>
    );
}

export default MyMain;
